import React, { useState, useEffect } from 'react';
import BackendAPI from './API/BackendAPI';

function App(){
  
  return (
    <div>
      {!loggedIn ? (<LogIn login={login} />) : 
      (<div>
        <LoggedIn />
        <button onClick={logout}>Logout</button>
      </div>)}
    </div>
  )

}
export default App;
